(1, 'DTRX6160771', '<p><span class=\"date_today\"><b>December 11, 2019</b></span><span>&nbsp;</span></p><p><span><br></span></p><p><span style=\"font-weight: bold;\">MR.&nbsp;</span><span class=\"first_name\"><b>Melody</b></span><span>&nbsp;</span><span class=\"middle_name\"><b></b></span><span>&nbsp;</span><span class=\"last_name\"><b>Cena</b></span><span>&nbsp;</span></p><p><span class=\"home_address1\"><b>Laguna</b></span><span>&nbsp;</span></p><p><span class=\"home_address2\"><b>De Bay</b></span><span>&nbsp;</span></p><p><span><br></span></p><p><span>Dear Mr.&nbsp;</span><span class=\"last_name\"><b>Cena</b></span><span>&nbsp;</span></p><p><span>We are writing to formally notify you that we are happy to have you on board!&nbsp;</span></p><p><span>For your employment with us, we are offering you the following terms and conditions:&nbsp;</span></p><p><span><br></span></p><p><span><span style=\"font-weight: bold;\">CLOUD PANDA PHILS INC. </span>is offering you a full time employment for the position of&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">Software Developer</span> </span><span class=\"input-text-container\"></span><span>&nbsp;</span><span class=\"position\">For your employment contract, we are pleased to offer you the following:&nbsp;</span></p><p><span class=\"position\"><br></span></p><p><span class=\"position\">For your employement contract, we are pleased to offer you the following:&nbsp;</span></p><p><span class=\"position\">a. One (1) Month Training</span></p><p><span class=\"position\">b. Five (5) Months Contractual&nbsp;</span></p><p><span class=\"position\">c. Six (6) Months Probationary</span></p><p><br></p><p>You will be directly reporting to <span style=\"font-weight: bold;\">Mr.&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">Paul Chua</span> </span><span class=\"input-text-container\"></span>our <span>&nbsp;<span class=\"font-weight-bold\">Development Manager</span> </span><span class=\"input-text-container\"></span>from <span style=\"font-weight: bold;\">Mondays to Saturday. </span>You are requested to render to work in 5 days week and <span style=\"font-weight: bold;\">atleast eight (8) hours of work </span>on a<span style=\"font-weight: bold;\">&nbsp;flexible Time In </span>between <span style=\"font-weight: bold;\">08:00 AM until 11:00 AM only </span>(log In time or start of shift) to 8pm only (log out time). Working time schedule will be based on the time in log and should be complete the 9 hours a day before time log out. For one (1) hour considered unpaid break time. You agree to render extended work hours when so required by the Employer.&nbsp;</p><p>For this position, we are pleased to offer you <span style=\"font-weight: bold;\">Php&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">20,000</span> </span><span class=\"input-text-container\"></span><span>/ monthly. Salary will be paid in a semi-monthly schedule (every 15th and 30th of the month) and will be released thru&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">Metro Bank </span> </span><span>&nbsp;<span class=\"font-weight-bold\">Debit Card</span> </span><span class=\"input-text-container\"></span><span class=\"input-text-container\"></span><span>provided by the Company.</span></p><p><span>As an employee, you are entitled to the following benefits:</span></p><p><span style=\"font-weight: bold;\">Mandatory Benefits:&nbsp;</span></p><p>The employee shall receive all the benefits required by Law which includes SSS, PHIC, HDMF and 13th month pay.</p><p>For SSS, PHIC and HDMF, please take note that the employer will deduct a certain amount from you monthly payroll as part of employee share. This deduction will be based on the given salary bracket from the said government agencies.</p><p><br></p><p><span style=\"font-weight: bold;\">HMO:&nbsp;</span></p><p>The employee shall receive a Health Card with a maximum benefit limit This will avail after 2 years of service in the company based on the employment of start date.</p><p><br></p><p>Should you be amenable to the above, please affix your signature on the space provided below as your acceptance of this employment offer.</p><p><br></p><p>Very Truly Yours,</p><p><br></p><p><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span>&nbsp;</span><br></p><p><span style=\"font-weight: 700;\">AIDA G. PADILLA</span></p><p><span>HR Manager</span></p><p><span><br></span></p><p><span>Conforme:</span></p><p><span><br></span></p><p><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span>&nbsp;</span><br></p><p><span class=\"first_name\"><b>Melody</b></span><span>&nbsp;</span><span class=\"middle_name\"><b></b></span><span>&nbsp;</span><span class=\"last_name\"><b>Cena</b></span><span>&nbsp;</span><span><br></span><span><br></span><span><br></span><span><br></span><span><br></span></p>', '2019-12-11 05:52:46', '0000-00-00 00:00:00', 1),
(2, 'JYDL0857079', '<p><span class=\"date_today\"><b>December 17, 2019</b></span><span>&nbsp;</span></p><p><span><br></span></p><p><span style=\"font-weight: bold;\">MR.&nbsp;</span><span class=\"first_name\"><b>Toby</b></span><span>&nbsp;</span><span class=\"middle_name\"><b></b></span><span>&nbsp;</span><span class=\"last_name\"><b>Maguire</b></span><span>&nbsp;</span></p><p><span class=\"home_address1\"><b>Queens, New York</b></span><span>&nbsp;</span></p><p><span class=\"home_address2\"><b></b></span><span>&nbsp;</span></p><p><span><br></span></p><p><span>Dear Mr.&nbsp;</span><span class=\"last_name\"><b>Maguire</b></span><span>&nbsp;</span></p><p><span>We are writing to formally notify you that we are happy to have you on board!&nbsp;</span></p><p><span>For your employment with us, we are offering you the following terms and conditions:&nbsp;</span></p><p><span><br></span></p><p><span><span style=\"font-weight: bold;\">CLOUD PANDA PHILS INC. </span>is offering you a full time employment for the position of&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">Software Developer</span> </span><span class=\"input-text-container\"></span><span>&nbsp;</span><span class=\"position\">For your employment contract, we are pleased to offer you the following:&nbsp;</span></p><p><span class=\"position\"><br></span></p><p><span class=\"position\">For your employement contract, we are pleased to offer you the following:&nbsp;</span></p><p><span class=\"position\">a. One (1) Month Training</span></p><p><span class=\"position\">b. Five (5) Months Contractual&nbsp;</span></p><p><span class=\"position\">c. Six (6) Months Probationary</span></p><p><br></p><p>You will be directly reporting to <span style=\"font-weight: bold;\">Mr.&nbsp;</span><span>&nbsp;<span class=\"font-weight-bold\">Paul Chua</span> </span><span class=\"input-text-container\"></span>our <span>&nbsp;<span class=\"font-weight-bold\">Development Manager</span> </span><span class=\"input-text-container\"></spa