yment of start date.</p><p><br></p><p>Should you be amenable to the above, please affix your signature on the space provided below as your acceptance of this employment offer.</p><p><br></p><p>Very Truly Yours,</p><p><br></p><p><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span>&nbsp;</span><br></p><p><span style=\"font-weight: 700;\">AIDA G. PADILLA</span></p><p><span>HR Manager</span></p><p><span><br></span></p><p><span>Conforme:</span></p><p><span><br></span></p><p><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span>&nbsp;</span><br></p><p><span class=\"first_name\"><b>Toby</b></span><span>&nbsp;</span><span class=\"middle_name\"><b></b></span><span>&nbsp;</span><span class=\"last_name\"><b>Maguire</b></span><span>&nbsp;</span><span><br></span><span><br></span><span><br></span><span><br></span><span><br></span></p>', '2019-12-17 05:53:05', '0000-00-00 00:00:00', 1);
