family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">For your <b>employment contract</b>, we are pleased to\noffer you the following:<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"margin-left:1.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\nArial\">a.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">One (1) Month Training<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"margin-left:1.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\nArial\">b.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Five (5) Months Contractual<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"margin-left:1.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\nArial\">c.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"font-size:12.0pt;\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Six (6) Months Probationary<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You will be directly\nreporting to </span><input type=\"text\" class=\"form-control input-text\" style=\"width:100px !important;border:none;border-bottom: 1px solid black;display:inline !important;\"><span>&nbsp;</span><span class=\"input-text-container\"></span><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><b>&nbsp;</b>our </span><input type=\"text\" class=\"form-control input-text\" style=\"width:100px !important;border:none;border-bottom: 1px solid black;display:inline !important;\"><span>&nbsp;</span><span class=\"input-text-container\"></span><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><b>&nbsp;</b>from<b> Mondays to Saturday</b>. You are requested\nto render to work in 5 days week and <b>atleast\neight (8) hours of work </b>on a<b>\nflexible Time In </b>between&nbsp;<b>08:00 AM\nuntil 11:00 AM only</b>(log In time or start of shift) to 8pm only(log out\ntime).Working time schedule will be based on the time in log and should be complete\nthe 9 hours a day before time log out. For one (1) hour considered unpaid break\ntime. You agree to render extended work hours when so required by the Employer.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">For this position, we\nare pleased to offer you Php&nbsp;</span><input type=\"text\" class=\"form-control input-text\" style=\"width:100px !important;border:none;border-bottom: 1px solid black;display:inline !important;\"><span>&nbsp;</span><span class=\"input-text-container\"></span><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><b>/ monthly</b>. Salary\nwill be paid in a semi-monthly schedule (every 15th and 30th of the month) and\nwill be released thru Metrobank debit card provided by the Company.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">As an employee, you\nare entitled to the following benefits:<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Mandatory\nBenefits:<o:p></o:p></span></b></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The employee shall\nreceive all the benefits required by Law which includes SSS, PHIC, HDMF and 13<sup>th</sup>\nmonth pay.<b><o:p></o:p></b></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">For SSS, PHIC and\nHDMF, please take note that the employer will deduct a certain amount form your\nmonthly payroll as part of employee share. This deduction will be based on the\ngiven salary bracket from the said government agencies.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Leave\nBenefits:<o:p></o:p></span></b></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Employee will be\nentitled to Six (6) days Sick Leave and Vacation Leave with pay after\nregularization. Unused leave credits are convertible to cash at the end of the\ncalendar year.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">HMO:<br>\n</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The\nemployee shall receive a Health Card with a maximum benefit limit of Php 70,000\nper illness per year. This will avail after 2 years of service in the company\nbased on the employment of start date.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Should you be\namenable to the above, please affix your signature on the space provided below\nas your acceptance of this employment offer.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Very Truly Yours,<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p><br></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">AIDA\nG. PADILLA</span></b></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; HR Manager<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Conforme:&nbsp;</span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span><span class=\"first_name\"><b>Mario</b></span><span style=\"font-size: 13px;\">&nbsp;</span><span class=\"middle_name\"><b></b></span><span style=\"font-size: 13px;\">&nbsp;</span><span class=\"last_name\"><b>Neri</b></span><span style=\"font-size: 13px;\">&nbsp;</span></p><p class=\"MsoNoSpacingCxSpLast\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormalCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\nmso-add-space:auto\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;line-height:115%;\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\nmso-add-space:auto\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;line-height:115%;\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\nmso-add-space:auto\"><span>&nbsp;</span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black;display:inline !important;\"><span style=\"font-family: Arial, sans-serif; font-size: 12pt;\"><br></span></p><p class=\"MsoNormalCxSpMiddle\" style=\"margin-bottom:0in;mar