(1, 'IUREREPREHENDERITS', 150, 12, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\">ADDENDUM TO EMPLOYMENT AGREEMENT</span></u></b></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\"><br></span></u></b><u><span style=\"font-size: 15pt;\"><o:p></o:p></span></u></span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><o:p style=\"font-family: Helvetica;\"></o:p><span style=\"font-family: Helvetica;\"></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">This will confirm the understanding you had with\nmanagement to the effect that you are employed by Cloud Panda PH Inc. as Software\nDeveloper. The terms and conditions of this agreement are as follows:</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In case of voluntary resignation, it is your\nobligation to inform the Company of your resignation (30) thirty days prior to\nthe effectively of such resignation to give the Company ample time to audit\naccountabilities, process clearances, look and train for replacement, and\neffect proper turnover of duties and responsibilities. In case you failed to\nfinish the said effectively period, you are authorizing the Company for\nautomatic deduction of your un-served days from your last pay.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In addition to the said standards, schedule of\nrelease of last pay is a month after the completion of clearance.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">Please signify your conformity hereto by signing\non the space provided herein below.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span><br></span><span class=\"first_name\"><b>Breanna</b></span><span class=\"middle_name\"><b>Judah Guerra</b></span><span class=\"last_name\"><b>Willis</b></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">     Employee</span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">       Date<br></span><br></span><span style=\"font-family: Helvetica;\"><br></span><span style=\"font-family: Arial, sans-serif;\"><o:p></o:p></span></p>\n              ', '2019-11-28 10:05:03', '0000-00-00 00:00:00', 1),
(2, 'IUREREPREHENDERITS', 150, 13, '<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:.15pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:.15pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:.45pt;margin-bottom:0in;\nmargin-left:0in;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-top:0in;margin-right:3.1pt;\nmargin-bottom:0in;margin-left:0in;margin-bottom:.0001pt;text-align:center;\ntext-indent:0in;line-height:normal\"><b><u><span lang=\"EN-PH\" style=\"font-size:15.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\">EMPLOYEES NON-DISCLOSURE AGREEMENT</span></u></b><span lang=\"EN-PH\" style=\"font-size:15.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:-.25pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">FOR\nGOOD CONSIDERATION, as an employee of <b>CLOUD\nPANDA, INC.</b>, the undersigned employee hereby agrees and acknowledges:<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:-.25pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:2.45pt;\nmargin-bottom:0in;margin-left:.25in;margin-bottom:.0001pt;mso-add-space:auto;\ntext-indent:-18.75pt;line-height:normal;mso-list:l3 level1 lfo2\"><!--[if !supportLists]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:\n12.0pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:arial\"=\"\">I.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n</span></span></b><!--[endif]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">CONFIDENTIALITY\nOF INFORMATION<o:p></o:p></span></b></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:2.45pt;\nmargin-bottom:0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;\ntext-indent:-.25in;line-height:normal;mso-list:l1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">In\nthe course of the employment with the Company, the Employee acknowledges that\nhe may receive confidential Information from the Employer.&nbsp; \"Information\" as used herein means\nall information, written or oral, furnished by the Employer to the Employee, or\nacquired by the Employee during the course of his employment with the Employer\n(whether such information is prepared by or obtained from the Employer itself,\nits clients, partners, advisors or otherwise), the production and manufacturing\ntechnology, together with business plans, financial statements, analyses, compilations,\nstudies, or technical Information consisting of methods, processes, formulae,\ncompositions, systems, techniques, inventions, machines, computer programs and\nresearch projects, or business Information consisting of customer lists,\npricing data, sources of supply, financial data and marketing, production, or\nmerchandising systems or plans, or other documents prepared by and/or received\nfrom the Employer its partners, agents, employees or representatives (including\nwithout limitation attorneys, accountants, analysts and financial advisors)\nwhich contain or otherwise reflect such information.<o:p></o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:2.45pt;\nmargin-bottom:0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;\ntext-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:\n12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:2.45pt;\nmargin-bottom:0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;\ntext-indent:-.25in;line-height:normal;mso-list:l1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The\nterm \"Information\" does not include any Information which (i) at the\ntime of disclosure or thereafter is generally available to and known by the\npublic (other than as a result of a disclosure directly or indirectly by the\nEmployer or its representatives), or (ii) is or becomes known to one of the\nEmployee on a non-confidential basis from a source other than the other\nEmployer or its advisors, provided that such source is not and was not either\nbound by a confidentiality agreement with either of the Employer or the\nEmployee or otherwise prohibited from transmitting such Information to a Party\nby a contractual, legal or fiduciary obligation. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:.05in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;\nline-height:normal;mso-list:l1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The\nEmployee agrees that it shall not, at any time during or following the\ntermination of his employment, directly or indirectly, divulge or disclose to\nany third party, for any purpose whatsoever, any of such confidential\nInformation which has been obtained by or disclosed to it as a result of its\nemployment with the Employer.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:.05in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;\nline-height:normal;mso-list:l1 level1 lfo3\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The\nEmployer agrees that any and all Information furnished to it by the Employer\nwill not be reproduced or disclosed to any person not a representative, agent\nor employee of the Employer without the expressed written approval of the\nEmployer.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:0in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:0in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:0in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.25in;margin-bottom:.0001pt;text-indent:-18.75pt;line-height:\nnormal;mso-list:l3 level1 lfo2\"><!--[if !supportLists]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:arial\"=\"\">II.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></b><!--[endif]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:\n12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">ACKNOWLEDGEMENT OF CONFIDENTIAL\nEMPLOYMENT<o:p></o:p></span></b></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;\nline-height:normal;mso-list:l2 level1 lfo4\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">I\nacknowledge that I am occupying a confidential position, the Management expects\nme to protect to the highest level the Companys trade secrets. I acknowledged\nthat I must refrained from joining directly or indirectly any company, which\nare engaged in the same or similar line of business as that of Cloud Panda,\nInc. within three (3) years from the date of my separation from the Company.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.25in;margin-bottom:.0001pt;text-indent:-.25in;line-height:\nnormal;mso-list:l3 level1 lfo2\"><!--[if !supportLists]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:arial\"=\"\">III.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp; </span></span></b><!--[endif]--><b><span lang=\"EN-PH\" style=\"mso-bidi-font-size:\n12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">OBLIGATIONS UPON TERMINATION OF\nEMPLOYMENT<o:p></o:p></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.25pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Upon\nthe termination of my employment from the Company:<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.25pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.75pt;margin-bottom:.0001pt;text-indent:-17.75pt;line-height:\nnormal;mso-list:l0 level2 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:=\"\" arial\"=\"\">(a)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\">I shall return to the Company all documents,\nrecords and property belonging to the Company, including but not necessarily\nlimited to: drawings, blueprints, reports, manuals, correspondence, customer\nlists, computer programs, and all other materials and all copies thereof\nrelating in any way to the Company\'s business, or in any way obtained by me\nduring the course of employ. I further agree that I shall not retain any copies,\nnotes or abstracts of the foregoing.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.75pt;margin-bottom:.0001pt;text-indent:-17.75pt;line-height:\nnormal;mso-list:l0 level2 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:=\"\" arial\"=\"\">(b)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\">The Company may notify any future or\nprospective employer or third party of the existence of this agreement and\nundertaking, and shall be entitled to full injunctive relief for any breach\nthereof.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:0in;margin-bottom:.0001pt;text-indent:0in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:35.75pt;margin-bottom:.0001pt;text-indent:-17.75pt;line-height:\nnormal;mso-list:l0 level2 lfo1\"><!--[if !supportLists]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:=\"\" arial\"=\"\">(c)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;\n</span></span><!--[endif]--><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\">This agreement shall be binding upon me and\nmy personal representatives and successors in interest, and shall inure to the\nbenefit of the Company, its successors and assigns.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-left:0in;text-indent:0in\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;line-height:103%;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-left:0in;text-indent:0in\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;line-height:103%;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:.5pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:-.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal;\ntab-stops:52.8pt center 71.8pt 125.95pt 2.5in 224.05pt 320.55pt right 454.15pt\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Signed\nthis&nbsp;</span><span>&nbsp;</span><span>&nbsp;<span>28th</span> </span><span class=\"input-text-container\"></span><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">day of&nbsp; </span><span>&nbsp;<span>November</span> </span><span class=\"input-text-container\"></span><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">,\n<span style=\"background:aqua;mso-highlight:aqua\">2019</span>.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:-.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal;\ntab-stops:center 71.8pt 125.95pt 2.5in 224.05pt 320.55pt right 454.15pt\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:-.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal;\ntab-stops:center 71.8pt 125.95pt 2.5in 224.05pt 320.55pt right 454.15pt\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\nmargin-left:-.75pt;margin-bottom:.0001pt;text-indent:0in;line-height:normal;\ntab-stops:center 71.8pt 125.95pt 2.5in 224.05pt 320.55pt right 454.15pt\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:2.45pt;margin-bottom:\n0in;margin-left:-.25pt;margin-bottom:.0001pt;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Conforme:<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:0in;\nline-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin:0in;margin-bottom:.0001pt;text-indent:0in;\nline-height:normal\"><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:12.0pt;\nfont-family:\" arial\",\"sans-serif\"\"=\"\"><o:p><br></o:p></span></p>\n\n<p class=\"MsoNormalCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\nmso-add-space:auto;line-height:normal\"><span>&nbsp;</span><span class=\"first_name\" style=\"text-align: justify;\"><b>Breanna</b></span><span style=\"text-align: justify;\">&nbsp;</span><span class=\"middle_name\" style=\"text-align: justify;\"><b>Judah Guerra</b></span><span style=\"text-align: justify;\">&nbsp;</span><span class=\"last_name\" style=\"text-align: justify;\"><b>Willis</b></span><span style=\"text-align: justify;\">&nbsp;</span></p>\n\n<p class=\"MsoNormalCxSpFirst\" style=\"margin:0in;margin-bottom:.0001pt;mso-add-space:\nauto;text-indent:.5in;line-height:normal\"><span lang=\"EN-PH\" style=\"mso-bidi-font-size:\n12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Employee<o:p></o:p></span></p>\n              ', '2019-11-28 10:05:03', '0000-00-00 00:00:00', 1),
(3, 'LOGE6035224', 151, 10, '<p><span class=\"date_today\"><b>December 03, 2019</b></span><span></span></p><p><span><br></span></p><p><span style=\"font-weight: bold;\">MR.</span><span class=\"first_name\"><b>Mila</b></span><span></span><span class=\"middle_name\"><b>Sicuan</b></span><span></span><span class=\"last_name\"><b>Neri</b></span><span></span></p><p><span class=\"home_address1\"><b>Puncan, Carranglan Nueva Ecija</b></span><span></span></p><p><span class=\"home_address2\"><b></b></span><span></span></p><p><span><br></span></p><p><span>Dear Mr.</span><span class=\"last_name\"><b>Neri</b></span><span></span></p><p><span>We are writing to formally notify you that we are happy to have you on board!</span></p><p><span>For your employment with us, we are offering you the following terms and conditions:</span></p><p><span><br></span></p><p><span><span style=\"font-weight: bold;\">CLOUD PANDA PHILS INC. </span>is offering you a full time employment for the position of</span><span class=\"position\"><b>HR Staff</b>For your employment contract, we are pleased to offer you the following:</span></p><p><span class=\"position\"><br></span></p><p><span class=\"position\">For your employement contract, we are pleased to offer you the following:</span></p><p><span class=\"position\">a. One (1) Month Training</span></p><p><span class=\"position\">b. Five (5) Months Contractual</span></p><p><span class=\"position\">c. Six (6) Months Probationary</span></p><p><br></p><p>You will be directly reporting to <span style=\"font-weight: bold;\">Mr.</span><span class=\"manager_name\"><b>null</b></span>our<span class=\"manager_position\"><b>null</b></span>from <span style=\"font-weight: bold;\">Mondays to Saturday. </span>You are requested to render to work in 5 days week and <span style=\"font-weight: bold;\">atleast eight (8) hours of work </span>on a<span style=\"font-weight: bold;\">flexible Time In </span>between <span style=\"font-weight: bold;\">08:00 AM until 11:00 AM only </span>(log In time or start of shift) to 8pm only (log out time). Working time schedule will be based on the time in log and should be complete the 9 hours a day before time log out. For one (1) hour considered unpaid break time. You agree to render extended work hours when so required by the Employer.</p><p>For this position, we are pleased to offer you <span style=\"font-weight: bold;\">Php</span><span class=\"total_sal\"><b>28,833.33</b></span><span>/ monthly. Salary will be paid in a semi-monthly schedule (every 15th and 30th of the month) and will be released thru</span><span class=\"bank\"><b>Bank </b></span><span></span><span class=\"payout_medium\"><b>Debit Card</b></span><span>provided by the Company.</span></p><p><span>As an employee, you are entitled to the following benefits:</span></p><p><span style=\"font-weight: bold;\">Mandatory Benefits:</span></p><p>The employee shall receive all the benefits required by Law which includes SSS, PHIC, HDMF and 13th month pay.</p><p>For SSS, PHIC and HDMF, please take note that the employer will deduct a certain amount from you monthly payroll as part of employee share. This deduction will be based on the given salary bracket from the said government agencies.</p><p><br></p><p><span style=\"font-weight: bold;\">HMO:</span></p><p>The employee shall receive a Health Card with a maximum benefit limit This will avail after 2 years of service in the company based on the employment of start date.</p><p><br></p><p>Should you be amenable to the above, please affix your signature on the space provided below as your acceptance of this employment offer.</p><p><br></p><p>Very Truly Yours,</p><p><br></p><p><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span></span><br></p><p><span style=\"font-weight: 700;\">AIDA G. PADILLA</span></p><p><span>HR Manager</span></p><p><span><br></span></p><p><span>Conforme:</span></p><p><span><br></span></p><p><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span></span><br></p><p><span class=\"first_name\"><b>Mila</b></span><span></span><span class=\"middle_name\"><b>Sicuan</b></span><span></span><span class=\"last_name\"><b>Neri</b></span><span></span><span><br></span><span><br></span><span><br></span><span><br></span><span><br></span></p>', '2019-12-03 09:27:20', '0000-00-00 00:00:00', 1);
