(4, 'QISH0132016', 152, 15, '<p class=\"MsoNormal\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; background: aqua;\"><o:p></o:p></span></span></p><p class=\"MsoNormal\"><a name=\"_GoBack\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; background: aqua;\">MR.</span></span></a><span class=\"first_name\"><span style=\"font-weight: bolder;\">First Name</span></span><span class=\"middle_name\"><span style=\"font-weight: bolder;\">Middle Name</span></span><span class=\"last_name\"><span style=\"font-weight: bolder;\">Last Name</span></span><a name=\"_GoBack\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; background: aqua;\"><o:p></o:p></span></span></a></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span class=\"home_address1\"><span style=\"font-weight: bolder;\">Home Address 1</span></span><br></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span class=\"home_address2\"><span style=\"font-weight: bolder;\">Home Address 2</span></span><br></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">Dear<span style=\"background: aqua;\">Mr.</span></span><span class=\"last_name\"><span style=\"font-weight: bolder;\">Last Name</span></span><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">CONGRATULATIONS!<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">We found that you have satisfactorily met the standard of the Company and have qualified to be a regular employee of our organization.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">We are therefore, extending this<span style=\"font-weight: bolder;\">Regular Appointment</span>to you under the following terms and conditions:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"730\" style=\"width: 438pt; margin-left: 35.4pt;\"><tbody><tr><td width=\"290\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 174pt;\"><h4><span style=\"font-size: 11pt; text-transform: uppercase;\">POSITION:</span><span style=\"font-size: 11pt; text-transform: uppercase;\"><o:p></o:p></span></h4></td><td width=\"440\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 264pt;\"><h1 style=\"text-align: justify;\"><span class=\"position\"><span style=\"font-weight: bolder;\">Position</span></span><br></h1></td></tr><tr><td width=\"290\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 174pt;\"><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; text-transform: uppercase;\">DEPARTMENT/SECTION:</span></span><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; text-transform: uppercase;\"><o:p></o:p></span></span></p></td><td width=\"440\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 264pt;\"><p class=\"MsoNormal\" style=\"text-align: justify;\"><span class=\"department\"><span style=\"font-weight: bolder;\">Department</span></span><br></p></td></tr><tr><td width=\"290\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 174pt;\"><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; text-transform: uppercase;\">EFFECTIVITY:</span></span><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; text-transform: uppercase;\"><o:p></o:p></span></span></p></td><td width=\"440\" valign=\"top\" style=\"padding: 0in 5.4pt; width: 264pt;\"><p class=\"MsoNormal\" style=\"text-align: justify;\"><input type=\"text\" class=\"form-control input-text\" style=\"border-top: none; border-right: none; border-bottom-color: black; border-left: none; display: inline !important; width: 100px !important;\"><span class=\"input-text-container\"></span><br></p></td></tr></tbody></table><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">You shall be entitled to fringe benefits as granted by this Company to all regular employees in accordance with the Company Policies and Procedures, such as:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">You have to obligation to strictly comply with all Company Rules and Regulations. You u