></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">Again, congratulations and we welcome you to the growing family of CLOUD PANDA PH INC.,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">Very truly yours,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-weight: bolder;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><br></p><h2 style=\"font-family: Montserrat, sans-serif; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"font-weight: bolder;\">MR. JONATHAN P. SO<o:p></o:p></span></h2><h2 style=\"font-family: Montserrat, sans-serif; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"font-weight: bolder;\">CEO/President<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">    Attestedby</span></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">   </span><canvas class=\"signature-pad\" width=\"300\" height=\"100\"></canvas></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\">    <span style=\"font-weight: bolder; text-indent: -1in;\">MR. CARLITO B. MACADANGDANG</span><span style=\"font-weight: bolder; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\"></span></span></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-weight: bolder; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt;\">sdf <span style=\"font-weight: bold;\">CFO/ VICE PRESIDENT      </span></span></span></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; text-indent: -1in;\">D   Date:</span><span></span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black;display:inline !important;\">    </p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\">     </p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\">     <span style=\"font-weight: bold;\">Conforme</span></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-weight: bold;\">    </span><span></span><canvas class=\"signature-pad\" width=\"300\" height=\"100\"></canvas></p><p class=\"MsoNormal\" style=\"margin-left: 49.65pt; text-indent: -1in;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; text-indent: -1in;\">    </span><span class=\"first_name\"><b>Kobe</b></span><span></span><span class=\"middle_name\"><b></b></span><span></span><span class=\"last_name\"><b>Bryant</b></span><span></span></p>\n              ', '2019-12-11 10:12:20', '0000-00-00 00:00:00', 1),
(7, 'QISH0132016', 155, 12, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\">ADDENDUM TO EMPLOYMENT AGREEMENT</span></u></b></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\"><br></span></u></b><u><span style=\"font-size: 15pt;\"><o:p></o:p></span></u></span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><o:p style=\"font-family: Helvetica;\"></o:p><span style=\"font-family: Helvetica;\"></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">This will confirm the understanding you had with\nmanagement to the effect that you are employed by Cloud Panda PH Inc. as Software\nDeveloper. The terms and conditions of this agreement are as follows:</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In case of voluntary resignation, it is your\nobligation to inform the Company of your resignation (30) thirty days prior to\nthe effectively of such resignation to give the Company ample time to audit\naccountabilities, process clearances, look and train for replacement, and\neffect proper turnover of duties and responsibilities. In case you failed to\nfinish the said effectively period, you are authorizing the Company for\nautomatic deduction of your un-served days from your last pay.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\