(13, 'UZQP9870795', 201, 12, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\">ADDENDUM TO EMPLOYMENT AGREEMENT</span></u></b></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\"><br></span></u></b><u><span style=\"font-size: 15pt;\"><o:p></o:p></span></u></span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><o:p style=\"font-family: Helvetica;\"></o:p><span style=\"font-family: Helvetica;\"></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">This will confirm the understanding you had with\nmanagement to the effect that you are employed by Cloud Panda PH Inc. as Software\nDeveloper. The terms and conditions of this agreement are as follows:</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In case of voluntary resignation, it is your\nobligation to inform the Company of your resignation (30) thirty days prior to\nthe effectively of such resignation to give the Company ample time to audit\naccountabilities, process clearances, look and train for replacement, and\neffect proper turnover of duties and responsibilities. In case you failed to\nfinish the said effectively period, you are authorizing the Company for\nautomatic deduction of your un-served days from your last pay.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In addition to the said standards, schedule of\nrelease of last pay is a month after the completion of clearance.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">Please signify your conformity hereto by signing\non the space provided herein below.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span></span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span><br></span><span class=\"first_name\"><b>Mario </b></span><span class=\"middle_name\"><b></b></span><span class=\"last_name\"><b>Nerit</b></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">     Employee</span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">       Date<br></span><br></span><span style=\"font-family: Helvetica;\"><br></span><span style=\"font-family: Arial, sans-serif;\"><o:p></o:p></span></p>\n              ', '2020-03-05 07:23:27', '0000-00-00 00:00:00', 1),
(14, 'SISC7625198', 204, 10, '<p><span class=\"date_today\"><b>December 12, 2019</b></span><span></span></p><p><span><br></span></p><p><span style=\"font-weight: bold;\">MR.</span><span class=\"first_name\"><b>Marky</b></span><span></span><span class=\"middle_name\"><b></b></span><span></span><span class=\"last_name\"><b>Neri</b></span><span></span></p><p><span class=\"home_address1\"><b>Carranglan, Nueva Ecija</b></span><span></span></p><p><span class=\"home_address2\"><b>Tramo, Pasay City</b></span><span></span></p><p><span><br></span></p><p><span>Dear Mr.</span><span class=\"last_name\"><b>Neri</b></span><span></span></p><p><span>We are writing to formally notify you that we are happy to have you on board!</span></p><p><span>For your employment with us, we are offering you the following terms and conditions:</span></p><p><span><br></span></p><p><span><span style=\"font-weight: bold;\">CLOUD PANDA PHILS INC. </span>is offering you a full time employment for the position of</span><span><span>Mobile Developer</span> </span><span class=\"input-text-container\"></span><span></span><span class=\"position\">For your employment contract, we are pleased to offer you the following:</span></p><p><span class=\"position\"><br></span></p><p><span class=\"position\">For your employement contract, we are pleased to offer you the following:</span></p><p><span class=\"position\">a. One (1) Month Training</span></p><p><span class=\"position\">b. Five (5) Months Contractual</span></p><p><span class=\"position\">c. Six (6) Months Probationary</span></p><p><br></p><p>You will be directly reporting to <span style=\"font-weight: bold;\">Mr.</span><span><span>Paul Chua</span> </span><span class=\"input-text-container\"></span>our <span><span>Development</span> </span><span class=\"input-text-container\"></span>from <span style=\"font-weight: bold;\">Mondays to Saturday. </span>You are requested to render to work in 5 days week and <span style=\"font-weight: bold;\">atleast eight (8) hours of work </span>on a<span style=\"font-weight: bold;\">flexible Time In </span>between <span style=\"font-weight: bold;\">08:00 AM until 11:00 AM only </span>(log In time or start of shift) to 8pm only (log out time). Working time schedule will be based on the time in log and should be complete the 9 hours a day before time log out. For one (1) hour considered unpaid break time. You agree to render extended work hours when so required by the Employer.</p><p>For this position, we are pleased to offer you <span style=\"font-weight: bold;\">Php</span><span><span>40,000.00</span> </span><span class=\"input-text-container\"></span><span>/ monthly. Salary will be paid in a semi-monthly schedule (every 15th and 30th of the month) and will be released thru</span><span><span>Metro Bank</span> </span><span><span>Debit Card</span> </span><span class=\"input-text-container\"></span><span class=\"input-text-container\"></span><span>provided by the Company.</span></p><p><span>As an employee, you are entitled to the following benefits:</span></p><p><span style=\"font-weight: bold;\">Mandatory Benefits:</span></p><p>The employee shall receive all the benefits required by Law which includes SSS, PHIC, HDMF and 13th month pay.</p><p>For SSS, PHIC and HDMF, please take note that the employer will deduct a certain amount from you monthly payroll as part of employee share. This deduction will be based on the given salary bracket from the said government agencies.</p><p><br></p><p><span style=\"font-weight: bold;\">HMO:</span></p><p>The employee shall receive a Health Card with a maximum benefit limit This will avail after 2 years of service in the company based on the employment of start date.</p><p><br></p><p>Should you be amenable to the above, please affix your signature on the space provided below as your acceptance of this employment offer.</p><p><br></p><p>Very Truly Yours,</p><p><br></p><p><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span></span><br></p><p><span style=\"font-weight: 700;\">AIDA G. PADILLA</span></p><p><span>HR Manager</span></p><p><span><br></span></p><p><span>Conforme:</span></p><p><span><br></span></p><p><img class=\"signature-pad-img\" src=\"data:image/png;base64,\" alt=\"\"><span></span><br></p><p><span class=\"first_name\"><b>Marky</b></span><span></span><span class=\"middle_name\"><b></b></span><span></span><span class=\"last_name\"><b>Neri</b></span><span></span><span><br></span><span><br></span><span><br></span><span><br></span><span><br></span></p>', '2020-03-20 02:23:02', '0000-00-00 00:00:00', 1);
