(21, 'YOQE2909228', 174, 12, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\">ADDENDUM TO EMPLOYMENT AGREEMENT</span></u></b></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\"><br></span></u></b><u><span style=\"font-size: 15pt;\"><o:p></o:p></span></u></span></p>\n\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><o:p style=\"font-family: Helvetica;\"></o:p><span style=\"font-family: Helvetica;\"></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">This will confirm the understanding you had with\nmanagement to the effect that you are employed by Cloud Panda PH Inc. as Software\nDeveloper. The terms and conditions of this agreement are as follows:</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In case of voluntary resignation, it is your\nobligation to inform the Company of your resignation (30) thirty days prior to\nthe effectively of such resignation to give the Company ample time to audit\naccountabilities, process clearances, look and train for replacement, and\neffect proper turnover of duties and responsibilities. In case you failed to\nfinish the said effectively period, you are authorizing the Company for\nautomatic deduction of your un-served days from your last pay.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In addition to the said standards, schedule of\nrelease of last pay is a month after the completion of clearance.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">Please signify your conformity hereto by signing\non the space provided herein below.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span></span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span><br></span><span class=\"first_name\"><b>Tony</b></span><span class=\"middle_name\"><b></b></span><span class=\"last_name\"><b>Stark</b></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">     Employee</span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span></span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black\"><br></p><p class=\"MsoNormal\" styl