ss=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The Training shalltake effect on</span><span class=\"contract_start\"><b>2020-03-03</b></span><span></span><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"> and shall end on </span><span class=\"contract_end\"><b>2020-05-04</b></span><span></span><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">,subject to extension of not exceeding 3 months, at the discretion of theCompany.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Salary/Wage</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">You shall receiveyour salary in a semi-monthly no-work-no-pay basis based on the following:<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:1.5in;margin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo1\"><span class=\"sal_cat\"><b></b></span></p><p><b>Basic Allowance:   20000 / month</b></p><p><b>Communication Allowance:   5000 / month</b></p><p><b>Food Allowance:   5000 / month</b></p><span></span><br><p></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">TrainingHours:</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpFirst\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The Training scheduleis a<b>5 days a week</b>from <b>Mondays to Friday.</b>You are requestedto render to work in 5 days week and <b>atleasteight (8) hours of work </b>on a<b>flexible Time In </b>between <b>08:00 AMuntil 11:00 AM only </b>(log In time or start of shift) to 8pm only(log outtime).Working time schedule will be based on the time in log and should becomplete the 9 hours a day before time log out. For one (1) hour consideredunpaid break time. You agree to render extended work hours when so required bythe Employer.<o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpMiddle\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNoSpacingCxSpLast\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Rulesand Regulations</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">It shall be yourobligation to strictly comply with and observe all rules and regulations of theCompany, which you acknowledge to have been made known to you. You are awarethat corresponding disciplinary action will be imposed for each infractions orviolations the said rules and regulations.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Uniform:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">During the TrainingPeriod, the Trainee may be required to wear Company uniform, in which case, youagree that the requirement of wearing such uniform shall not be construed, inany manner, that you have become an employee of the Company.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">NoEmployment Guarantee:</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The completion of theTraining Course shall not automatically entitle the Trainee the right to beemployed by the Company. The Company reserves the right to choose whom to hireamong the qualified Trainees taking into consideration the result of theoverall performance during the Training period.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">Terminationof Training Agreement:</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">The Training periodmay be terminated at any time for any causes, whatsoever, including but notlimited to, inability to learn and undertake the duties of the position you arebeing trained for, inefficiency, recession of business, personnel reductionand/or violation of Company Rules and Regulations. In any event, you shall begiven notice of termination at any time, during any working day, in which case,the Training Period shall be terminated at the close of the working hoursstated in the Notice of Termination. The Company undertakes in that event topay your Training Allowance for the days when the Trainee actually reported forTraining. At no instance will the Trainee be entitled to the payment of any amountother than the Training Allowance for the day the Trainee actually reported forTraining.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\">If you are agreeableto the above terms and conditions, please signify your acceptance by signing atthe bottom hereof.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:\" arial\",\"sans-serif\"\"=\"\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;li