(35, 'YTWX3444500', 205, 18, '<p class=\"MsoTitle\" style=\"text-align: center;\"><span style=\"font-size:15.0pt\">FIXED SERVICE CONTRACT</span></p><p class=\"MsoTitle\" style=\"text-align: center;\"><span style=\"font-size: 12pt;\">TERMS AND CONDITION<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:10.0pt\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p><span class=\"date_today\"><b>April 02, 2020</b></span><span>&nbsp;</span></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span class=\"first_name\"><b>Chris</b></span><span>&nbsp;</span><span class=\"middle_name\"><b></b></span><span>&nbsp;</span><span class=\"last_name\"><b>Redfield</b></span><span>&nbsp;</span></p><p class=\"MsoNormal\"><span class=\"home_address1\"><b>Trramo</b></span><span>&nbsp;</span></p><p class=\"MsoNormal\"><span class=\"home_address2\"><b>Ttramo</b></span><span>&nbsp;</span><span><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\">Dear Mr.&nbsp;<span class=\"last_name\"><b>Redfield</b></span><span>&nbsp;,</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\">We are pleased to confirm your <b>Contractual Employment</b> with Cloud Panda\nInc. with a designation of <span class=\"position\"><b>Mobile Developer</b></span><span>&nbsp;</span>. Your\nemployment shall be subject to the following terms and conditions:<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:.75in;mso-add-space:auto;\ntext-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; fo