-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Your benefits and privileges shall be limited to those mandated by law.<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.75in;mso-add-space:\nauto;text-align:justify;tab-stops:117.0pt\"><span style=\"font-size:6.0pt;\nmso-bidi-font-size:11.0pt;mso-bidi-font-family:Arial;mso-bidi-font-weight:bold\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size:7.0pt;mso-bidi-font-size:11.0pt;mso-bidi-font-family:Arial;\nmso-bidi-font-weight:bold\"><o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.75in;mso-add-space:\nauto;text-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->You will report to <b>Mr. Paul Vincent D. Chua</b>, <b>Development and\nOperations Manager</b>, who will direct and monitor the performance of your\nduties and responsibilities.<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\"><span style=\"font-size:6.0pt;mso-bidi-font-size:\n11.0pt;mso-bidi-font-family:Arial;mso-bidi-font-weight:bold\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:.75in;mso-add-space:\nauto;text-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]-->5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Your service will be dispensed upon the expiration of this contract, on <span class=\"contract_end\"><b>2020-06-16</b></span><span>&nbsp;</span>without a need of prior\nnotice. You understand that your services may be terminated even before the end\nof the said period at the discretion of the company.<o:p></o:p></p><p class=\"MsoListParagraphCxSpLast\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\" style=\"text-align:justify\">Please indicate\nyour understanding and acceptance to the foregoing terms and conditions by\nsigning your name on the space provided below.</p><p class=\"MsoNormal\" style=\"text-align:justify\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><b><br></b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>CARLITO B. MACADANGDANG</b></p><p class=\"MsoNormal\" style=\"text-align:justify\"><i><span style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;mso-bidi-font-family:\nArial;mso-bidi-font-weight:bold\">Vice President, Cloud Panda PH, Inc.</span></i></p><p class=\"MsoNormal\" style=\"text-align:justify\"><i><span style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;mso-bidi-font-family:\nArial;mso-bidi-font-weight:bold\"><o:p><br></o:p></span></i></p><p class=\"MsoNormal\" style=\"text-align:justify\"><i><span style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;mso-bidi-font-family:\nArial;mso-bidi-font-weight:bold\"><o:p>Conforme:</o:p></span></i></p><p class=\"MsoNormal\" style=\"text-align:justify\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><i><span style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;mso-bidi-font-family:\nArial;mso-bidi-font-weight:bold\"><o:p><br></o:p></span></i></p><p class=\"MsoNormal\" style=