(1, 'Job Offer Templates', '<p><span class=\"date_today\"><span style=\"font-weight: bolder;\">Date Today&nbsp;</span></span></p><p><span class=\"date_today\"><span style=\"font-weight: bolder;\"><br></span></span></p><p><span class=\"date_today\"><span style=\"font-weight: bolder;\">MR.&nbsp;</span></span><span class=\"first_name\"><span style=\"font-weight: bolder;\">First Name&nbsp;</span></span><span class=\"middle_name\"><span style=\"font-weight: bolder;\">Middle Name&nbsp;</span></span><span class=\"last_name\"><span style=\"font-weight: bolder;\">Last Name&nbsp;</span></span></p><p><span class=\"home_address1\"><span style=\"font-weight: bolder;\">Home Address 1&nbsp;</span></span></p><p><span class=\"home_address2\"><span style=\"font-weight: bolder;\">Home Address 2</span></span><span class=\"home_address1\"><span style=\"font-weight: bolder;\"><br></span></span></p><p><span class=\"home_address1\"><span style=\"font-weight: bolder;\"><br></span></span></p><p><span class=\"home_address1\">Dear Mr.&nbsp;</span><span class=\"last_name\"><span style=\"font-weight: bolder;\">Last Name&nbsp;</span></span></p><p><span class=\"last_name\">We are writing to formalyy notify you that we are happy to have you on board!&nbsp;</span></p><p><span class=\"last_name\">For your employment with us, we are offering you the following terms and conditions:&nbsp;</span></p><p><span class=\"last_name\"><br></span></p><p><span class=\"last_name\"><span style=\"font-weight: bold;\">CLOUD PANDA PHILS INC.&nbsp;</span>is offering you a full time employement for the position of&nbsp;</span></p><p><span class=\"position\"><span style=\"font-weight: bolder;\">Position.&nbsp;</span>For your employment contract, we are pleased to offer you the following:&nbsp;</span></p><p><span class=\"position\"><br></span></p><p><span class=\"position\">For your&nbsp;<span style=\"font-weight: bold;\">employement contract</span>,&nbsp; we are pleased to offer you the following:&nbsp;</span></p><p></p><div style=\"text-align: justify;\">a. One (1) Month Training&nbsp;</div><div style=\"text-align: justify;\">b. Five (5) Months Contractual&nbsp;</div><div style=\"text-align: justify;\">c. Six (6) Months Probationary</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">You will be directly reporting to&nbsp;<span class=\"manager_name\"><span style=\"font-weight: bolder;\">Manager Name</span></span>&nbsp;our&nbsp;<span class=\"manager_position\"><span style=\"font-weight: bolder;\">Manager Position</span></span>&nbsp;from&nbsp;<span style=\"font-weight: bold;\">Monday to Saturday</span>.&nbsp;You are requested to render to work in 5 days week and&nbsp;<span class=\"total_whours\"><span style=\"font-weight: bolder;\">Total Work Hour (less break)&nbsp;</span>hours of work on a&nbsp;</span><span class=\"sched_type\"><span style=\"font-weight: bolder;\">Schedule Type Time In&nbsp;</span>between&nbsp;<span style=\"font-weight: bold;\">08:00 AM until 11:00 AM</span>&nbsp;only (log in time or start of shift) to 8pm only (log out time). Working time schedule will be based on the time in log and should be complete the&nbsp;</span><span class=\"total_whours2\"><span style=\"font-weight: bolder;\">Total Work Hours</span></span><span class=\"sched_type\">&nbsp;hours a day before time log out. For one (</span><span class=\"total_bhours\"><span style=\"font-weight: bolder;\">Total Break Hours</span></span><span class=\"sched_type\">) hour considered unpaid break time. You agree to render extended work hours when so required by Employer.&nbsp;</span></div><div style=\"text-align: justify;\"><span class=\"sched_type\"><br></span></div><div style=\"text-align: justify;\"><span class=\"sched_type\">For this position, we are pleased to offer you&nbsp;<span style=\"font-weight: bold;\">Php</span>&nbsp;</span><span class=\"total_sal\"><span style=\"font-weight: bolder;\">Total Salary / monthly.&nbsp;&nbsp;</span>Salary will be paid in a&nbsp;</span><span class=\"paytype\"><span style=\"font-weight: bolder;\">PayType</span></span></div><span class=\"last_name\">&nbsp;schedule (every 15th and 30th of the month) and will be released thru&nbsp;</span><span class=\"bank\"><span style=\"font-weight: bolder;\">Bank&nbsp;</span></span><span class=\"payout_medium\"><span style=\"font-weight: bolder;\">Payout Medium&nbsp;</span>provided by the Company.</span><p></p><p><span class=\"payout_medium\"><br></span></p><p><span class=\"payout_medium\">As an employee, your are entitled to the following benefits:&nbsp;</span></p><p><span class=\"payout_medium\" style=\"font-weight: bold;\">Mandatory Benefits:</span></p><p>The employee shall receive all the benefits required by Law which includes SSS, PHIC, HDMF and 13th Month Pay.</p><p>For SSS, PHIC AND HDMF, please take note that the employer will deduct a certain amount from your monthly payroll as part of employee share. This deduction will be based on the given salary bracked from the said government agencies.&nbsp;</p><p><span style=\"font-weight: bold;\">Leave Benefits:</span></p><p>Employee will be entitled to Six (6) days Sick Leave and Vacation Leave with pay after regularization. Unused leave credits are convertible to cash at the end of the calendar year.&nbsp;</p><p><span style=\"font-weight: bold;\">HMO:&nbsp;</span></p><p>The employee shall receive a Health Card with a maximum benefit limit of Php 70,000 per illness per year. This will avail after 2 years of service in the company based on the employment of start date.</p><p><br></p><p>Should you be amenable to the above, please affix your signature on the space provided below as your acceptance of this employment offer.</p><p><br></p><p>Very Truly Yours,</p><p><br></p><p>_________________</p><p><span class=\"hr_manager\"><span style=\"font-weight: bolder;\">HR Manager</span></span></p><p><span class=\"hr_manager\">HR Manager</span></p><p><span class=\"hr_manager\"><br></span></p><p><span class=\"hr_manager\">Conforme