\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black\"></p></td></tr></tbody></table><div style=\"text-align: left;\">CC: ACCOUNTING&nbsp;</div><div style=\"text-align: left;\"><br></div><div style=\"text-align: left;\"><div style=\"text-align: justify;\"><span style=\"font-weight: bold;\">NOTE TO EMPLOYEE:</span> This Contract addendum form part is an integral part of your contract of employment with the company. If you are agreeable to the foregoing terms and conditions, please sign in the space provided as an indication of your conformity and this shall serve as contract between you and the Company.</div><span style=\"font-weight: bold; text-decoration-line: underline;\"><br></span></div>', 'default', '2019-11-28 05:50:01', '0000-00-00 00:00:00', 1),
(12, 'Addendum', '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\">ADDENDUM TO EMPLOYMENT AGREEMENT</span></u></b></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span style=\"font-family: Helvetica;\"><b><u><span style=\"font-size: 15pt;\"><br></span></u></b><u><span style=\"font-size: 15pt;\"><o:p></o:p></span></u></span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><o:p style=\"font-family: Helvetica;\">&nbsp;</o:p><span style=\"font-family: Helvetica;\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">This will confirm the understanding you had with\r\nmanagement to the effect that you are employed by Cloud Panda PH Inc. as Software\r\nDeveloper. The terms and conditions of this agreement are as follows:</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In case of voluntary resignation, it is your\r\nobligation to inform the Company of your resignation (30) thirty days prior to\r\nthe effectively of such resignation to give the Company ample time to audit\r\naccountabilities, process clearances, look and train for replacement, and\r\neffect proper turnover of duties and responsibilities. In case you failed to\r\nfinish the said effectively period, you are authorizing the Company for\r\nautomatic deduction of your un-served days from your last pay.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">In addition to the said standards, schedule of\r\nrelease of last pay is a month after the completion of clearance.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\">Please signify your conformity hereto by signing\r\non the space provided herein below.</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span style=\"font-family: Helvetica;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span>&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><br></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span><br></span><span class=\"first_name\"><b>First Name</b></span>&nbsp;&nbsp;<span class=\"middle_name\"><b>Middle Name</b></span>&nbsp;<span class=\"last_name\"><b>Last Name</b></span>&nbsp;</p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Employee</span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span>&nbsp;</span><input type=\"text\" class=\"form-control date_input_empty\" style=\"width:200px !important;border:none;border-bottom: 1px solid black\"><br></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-left: 25px;\"><span><span style=\"font-family: Helvetica;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Date<br></span><br></span><span style=\"font-family: Helvetica;\"><br></span><span style=\"font-family: Arial, sans-serif;\"><o:p></o:p></span></p>\r\n              ', 'addendum', '2020-02-12 08:41:59', '0000-00-00 00:00:00', 1);
