uot;\">Uniform:<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">During the TrainingPeriod, the Trainee may be required to wear Company uniform, in which case, youagree that the requirement of wearing such uniform shall not be construed, inany manner, that you have become an employee of the Company.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">NoEmployment Guarantee:</span></b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">The completion of theTraining Course shall not automatically entitle the Trainee the right to beemployed by the Company. The Company reserves the right to choose whom to hireamong the qualified Trainees taking into consideration the result of theoverall performance during the Training period.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:justify;line-height:normal;tab-stops:353.25pt\"><b><span lang=\"EN-PH\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p><p class=