(15, 'Regular Agreement', '<p class=\"MsoNormal\"><span class=\"first_name\"><b>First Name</b></span><span>&nbsp;</span><span class=\"middle_name\"><b>Middle Name</b></span><span>&nbsp;</span><span class=\"last_name\"><b>Last Name</b></span><span>&nbsp;</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"home_address1\"><b>Home Address 1</b></span><span>&nbsp;</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"home_address2\"><b>Home Address 2</b></span><span>&nbsp;</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Dear Mr/Ms. </span><span class=\"last_name\"><b>Last Name</b></span><span>&nbsp;</span><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nmso-bidi-font-family:Arial\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><b><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">CONGRATULATIONS!<o:p></o:p></span></b></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We found that you have satisfactorily met the\r\nstandard of the Company and have qualified to be a regular employee of our\r\norganization.&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">We are therefore, extending this <b>Regular\r\nAppointment</b> to you under the following terms and conditions:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"730\" style=\"width: 438pt; margin-left: 35.4pt;\">\r\n <tbody><tr>\r\n  <td width=\"290\" valign=\"top\" style=\"width:174.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <h4><span style=\"font-size:11.0pt;mso-bidi-font-family:Arial;text-transform:\r\n  uppercase\">Position:</span><span style=\"font-size:11.0pt;mso-bidi-font-size:\r\n  12.0pt;mso-bidi-font-family:Arial;text-transform:uppercase\"><o:p></o:p></span></h4>\r\n  </td>\r\n  <td width=\"440\" valign=\"top\" style=\"width:264.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <h1 style=\"text-align:justify\"><span class=\"position\"><b>Position</b></span><span>&nbsp;</span><br></h1>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"290\" valign=\"top\" style=\"width:174.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.0pt;\r\n  font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;text-transform:uppercase\">Department/Section:</span></b><b><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;text-transform:uppercase\"><o:p></o:p></span></b></p>\r\n  </td>\r\n  <td width=\"440\" valign=\"top\" style=\"width:264.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"department\"><b>Department</b></span><span>&nbsp;</span><br></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"290\" valign=\"top\" style=\"width:174.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"text-align:justify\"><b><span style=\"font-size:11.0pt;\r\n  font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;text-transform:uppercase\">Effectivity:</span></b><b><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;text-transform:uppercase\"><o:p></o:p></span></b></p>\r\n  </td>\r\n  <td width=\"440\" valign=\"top\" style=\"width:264.0pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"contract_start\"><b>Contract Start</b></span><span>&nbsp;</span><br></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You shall be entitled to fringe benefits as\r\ngranted by this Company to all regular employees in accordance with the Company\r\nPolicies and Procedures, such as:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">You\r\nhave to obligation to strictly comply with all Company Rules and\r\nRegulations.&nbsp; You understand that\r\ncorresponding disciplinary action will be imposed for any infractions or\r\nviolations thereof.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Moreover,\r\nsince you are occupying a confidential position, the Company reminds you that\r\nyou are expected to protect to the highest level the Companys trade secrets,\r\nwhich includes but not limited to its formulas, procedures, and technology of\r\nproduction. Please be advised as well that you are restrained from joining as\r\nemployee, officer, director, stockholder or agent, directly or indirectly, with\r\nany company, which are engaged in the same or similar line of business as that\r\nof Cloud&nbsp; Panda PH Inc. within one (1)\r\nyear from the date your separation from the Company.&nbsp; For a more detailed statement and description\r\nof this obligation, please refer to the attached Non-Disclosure Agreement for\r\nEmployees, which you are required to execute after reading and understanding\r\nthe same.&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">For\r\nfurther exposure on your line of duty, and for the enhancement of your skills\r\nand abilities, the Company, as it deems fit, shall have the prerogative to\r\nassign and transfer you to any of its section, departments and work sites\r\nduring the period of your employment.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">May\r\nyou continue to give your best contribution to the continuing growth of the\r\nCompany and its Human Resources requirements by complying all the policy and\r\nprocedure.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Again, congratulations and we welcome you to\r\nthe growing family of CLOUD PANDA PH INC.,<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Very truly yours,&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\" style=\"touch-action: none;\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span><span style=\"font-weight: bold;\">MR. JONATHAN P. SO</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span><span style=\"font-weight: bold;\">CEO/ PRESIDENT&nbsp;</span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span><span style=\"font-weight: bold;\"><br></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span><span style=\"font-weight: bold;\"><br></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span><span style=\"font-weight: bold;\"><br></span></span><span style=\"font-weight: 700;\">MR/MS.&nbsp;</span><span class=\"first_name\"><b>First Name</b></span><span style=\"font-size: 13px;\">&nbsp;</span><span class=\"middle_name\"><b>Middle Name</b></span><span style=\"font-size: 13px;\">&nbsp;</span><span class=\"last_name\"><b>Last Name</b></span><span style=\"font-size: 13px;\">&nbsp;&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 13px;\">Conforme:</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 13px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 13px;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><canvas class=\"signature-pad\" width=\"300\" height=\"100\"></canvas><span>&nbsp;</span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span style=\"font-size: 13px;\"><br></span><span style=\"font-weight: bold;\">MR. CARLITO B. MACADANGDANG&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span><span style=\"font-weight: bold;\">CFO/ VICE PRESIDENT</span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span>Attested by:</span><span><br><br></span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span><span style=\"font-weight: bold;\"><br></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span><span style=\"font-weight: bold;\"><br></span><br></span><img class=\"signature-pad-img\" src=\"\" alt=\"\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><br></span></p>\r\n              ', 'default', '2020-01-22 07:29:18', '0000-00-00 00:00:00', 1),
