(17, 'Probationary Agreement', '<p class=\"MsoTitle\" align=\"left\"><span style=\"font-size:\r\n12.0pt\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoTitle\" style=\"text-align: center; \"><span style=\"font-size:12.0pt\">EMPLOYMENT AGREEMENT</span>&nbsp;</p>\r\n\r\n<p class=\"MsoTitle\" style=\"text-align: center;\"><span style=\"font-size: 12pt;\">TERMS AND CONDITION<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span style=\"font-size:10.5pt\"><o:p>&nbsp;</o:p></span></b></p>\r\n\r\n<p class=\"MsoNoSpacing\" style=\"text-align:justify\"><b><span lang=\"EN-PH\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><span class=\"first_name\"><b>First Name</b></span><span>&nbsp;</span><span class=\"middle_name\"><b>Middle Name</b></span><span>&nbsp;</span><span class=\"last_name\"><b>Last Name</b></span><span>&nbsp;</span><br></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"home_address1\"><b>Home Address 1</b></span><span>&nbsp;</span><br></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span class=\"home_address2\"><b>Home Address 2</b></span><span>&nbsp;</span><br></p>\r\n\r\n<p class=\"MsoNoSpacing\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNoSpacing\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"MsoNoSpacing\" style=\"text-align:justify\"><span lang=\"EN-PH\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Dear Mr/Ms. </span><span class=\"last_name\"><b>Last Name</b></span><span>&nbsp;</span><span lang=\"EN-PH\" style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">,</span>&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><b>WELCOME\r\nTO CLOUD PANDA INC</b>.<span style=\"text-transform:uppercase\">!</span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\">We are pleased to confirm your <b>Probationary employment</b> with Cloud\r\nPanda Inc. with a designation of&nbsp;<span class=\"position\"><b>Position</b></span><span>&nbsp;</span>.&nbsp;&nbsp; Your employment shall be\r\nsubject to the following terms and conditions:<b><o:p></o:p></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"1\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">Your probationary employment is commencing on&nbsp;<span class=\"contract_start\"><b>Contract Start</b></span><span>&nbsp; to&nbsp;</span><span class=\"contract_end\"><b>Contract End</b></span><span>&nbsp;</span><b>.</b>During this period, the Employer shall determine\r\n     your qualification and suitability for the job as&nbsp;<span class=\"position\"><b>Position</b></span><span>&nbsp;.</span><o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:12.0pt;text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"2\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You will be directly reporting to Mr. Paul Vincent Chua, our\r\n     Development and Operations Manager from Mondays to Saturdays. You\r\n     requested to render to work in 5 days per week and at least eight (8) hours\r\n     of work on a flexible time starting 8:00 am to 11:00 am (log In time or\r\n     start of shift) to 8pm only(log out time). You agree to render extended\r\n     work hours when so required by the Employer.&nbsp;&nbsp;&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:12.0pt;text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"3\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You acknowledge that the Employer, through its duly authorized\r\n     representative, has notified you, and that you fully understand the\r\n     Companys reasonable standard to qualify you as regular employee.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"4\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">On or before the expiration of the Probationary Period, the Company\r\n     shall evaluate your performance based on the Company standard that you\r\n     acknowledge to have been satisfactorily explain to you.&nbsp; The Employer shall notify you in writing\r\n     of the Job Performance Evaluation result, which shall be the basis of\r\n     whether your employment will be retained on a regular basis or terminated\r\n     for failure to meet the Companys standard and qualify as a regular\r\n     employee.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoListParagraph\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"5\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">In the event that your probationary employment is transform into a\r\n     regular employment, the terms and conditions contained in this Employment\r\n     Contract shall continue to apply insofar as your obligations as employee\r\n     are concerned.&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:24.0pt;text-align:justify;text-indent:\r\n-12.0pt;tab-stops:list 24.0pt\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"6\" type=\"1\">\r\n <li class=\"MsoNormal\">For giving\r\n     your entire time and attention to the work assigned to you, you shall\r\n     receive a salary of&nbsp;<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; \"><o:p>&nbsp;</o:p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"sal_cat\"><b>Salary</b></span><span>&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list .5in\"><!--[if !supportLists]-->7.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->As\r\nan employee, you are entitled to the following benefits:</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><b>Mandatory Benefits:</b> The employee shall receive all the benefits\r\nrequired by the law which includes SSS, PHIC, HDMF and 13<sup>th</sup> month\r\nPay.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\">For SSS, PHIC &amp; HDMF, please\r\ntake note that the Employer will deduct a certain amount from your payroll as\r\npart of your employee share contribution. This deduction will be based on the\r\ngiven salary bracket from the said government agencies.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.25in\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><b>Leave Benefits:</b> Employee will be entitled to six (6) days for Sick\r\nleave and Vacation Leave with pay upon regularization. Unused leave credits are\r\nconvertible to cash at the end of the calendar year.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.25in\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><b>HMO:</b> The employee shall receive a Health Card with a maximum\r\nbenefit limit of Php 70,000 per illness per year. This will avail after 2 years\r\nof service in the company based on the employment of start date. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\">Any additional payments or benefits of\r\nwhatever nature, except those mandated by law, are not demandable and rest\r\nentirely at the Employers discretion, and will not, even in the case of\r\nrepetition serve to establish any claim against the Employer.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:24.0pt;text-align:justify;text-indent:\r\n-12.0pt;tab-stops:list 24.0pt\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"8\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">Your salary now and in the future is strictly personal and\r\n     confidential between you and the Employer. Hence, you are hereby enjoin\r\n     from discussing this matter, under any circumstances, with anyone except\r\n     with appropriate members of Management and by appropriate procedures.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"9\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You agree to abide by all Companys Rules and Regulations.&nbsp; It shall be your duty to study and\r\n     understand such Company rules and regulations.&nbsp; Your employment with the Company is\r\n     exclusive and you agree not be engage, during your employment with the\r\n     Company, in any work with other employer/s whether within or outside your\r\n     working hours with the Company. <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"10\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You agree to give immediate notice to the Company of any claim that\r\n     you believe you are entitled to against the Company.&nbsp; Any claim not demanded within a period\r\n     of the 24 hours from the occurrence of such claim is deem waived and\r\n     abandoned.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"11\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">The Company shall not be responsible for any expenses that you may\r\n     incur in the execution of the duties of your position unless the Employer,\r\n     through its duly authorized representative, authorized the same prior to\r\n     the expenditure of such expenses.&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:24.0pt;text-align:justify;text-indent:\r\n-12.0pt;tab-stops:list 24.0pt\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"12\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You agree that all records and documents that belong to the Company\r\n     and all information pertaining to its trade, business or affairs are\r\n     strictly of confidential nature and that you will make no authorized\r\n     disclosure or reproduction of the same at any time during or after your\r\n     employment with the Company.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:24.0pt;text-align:justify;text-indent:\r\n-12.0pt;tab-stops:list 24.0pt\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"13\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You agree that all Company records, documents and assets in your\r\n     custody or control shall be immediately surrender to the Company if\r\n     requested during the employment period, and at the termination thereof,\r\n     whether or not requested.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoListParagraph\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"14\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">Since you are occupying a confidential position, the Employer\r\n     expects you to protect to the highest level the Companys trade secrets,\r\n     which includes but not limited to its formulas, procedures, and technology\r\n     of production.<o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"15\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">During the entire period of your employment (probationary or\r\n     regular), you agree to be assigned to any work or workplace for such\r\n     period as may be determined by the Employer whenever your services is\r\n     required to such new assignment. <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:12.0pt;text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"16\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">The Company reserves the right to terminate your services at any\r\n     time during the probationary period or any time thereafter should the\r\n     Company, exercising reasonable discretion, find that your job performance\r\n     is unsatisfactory based on Company standard that you acknowledge to have\r\n     been satisfactorily explain to you.&nbsp;\r\n     <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:12.0pt;text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"17\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">In the event that your employment becomes regular, that is after\r\n     you have successfully completed the probationary period to the\r\n     satisfaction of the Employer, you agree to execute the Non-Disclosure\r\n     Agreement for Employees.&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"18\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">During the period of your regular employment, the Employer may\r\n     require you to undergo certain training programs to enhance your\r\n     qualifications or to prepare you to handle other/new work assignment or\r\n     responsibilities (whether for lateral transfer or promotion to a higher\r\n     level).&nbsp; In such eventuality, you\r\n     agree to undergo relevant training and execute the corresponding training\r\n     agreement which shall govern the relationship between the Employee and the\r\n     Employer and may impose additional obligations on the part of the\r\n     Employee.&nbsp;&nbsp;&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"19\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">During the period of your regular employment, the Employer may\r\n     terminate your employment for just or authorized cause pursuant to the\r\n     provisions of the Presidential Decree 442, otherwise known as the Labor\r\n     Code of the Philippines. <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"20\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You acknowledge that in addition to the grounds for dismissal\r\n     provided by the Labor Code of the Philippines, violation of the terms and\r\n     conditions of your employment shall be sufficient ground to terminate your\r\n     employment with the Company.&nbsp;&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>\r\n\r\n<ol style=\"margin-top:0in\" start=\"21\" type=\"1\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;mso-list:l0 level1 lfo1;\r\n     tab-stops:list .5in\">You may terminate your employment with the Company (resignation) by\r\n     serving a written notice (resignation letter) at least 30-day prior to the\r\n     effectivity of the termination/resignation.&nbsp; During the 30-day transition period, you\r\n     agree to turnover to the Company all the documents, records, assets,\r\n     office supplies and any all Company property in your custody as employee\r\n     of the Company. Should you fail to strictly observed the requirements\r\n     under this Section 19, the Company reserves the right to: (a) withhold the\r\n     issuance of Clearance in your favor; and (b) withhold the payment of your\r\n     last salary until satisfactory compliance with this Section 20.&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></li>\r\n</ol>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><br></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p