INSERT INTO `hris_eval_questions` (`id`, `title`, `description`, `section`, `template`, `weights`, `created_at`, `updated_at`, `enabled`) VALUES
(1, 'KNOWLEDGE OF WORK', 'Evaluate the employees familiarity with all phases and details of the job. Measures effectiveness in keeping knowledgeable in methods, techniques and required skills; \r\nremaining current on new technologies and be able to apply it into the job in a short span of time.', 'A', 2, 20, '2020-01-21 08:34:29', '0000-00-00 00:00:00', 1),
(2, 'QUALITY OF WORK', ' Evaluate the employees ability to deliver products that conforms to its requirements, work reliably and accurately in its intended manner, delivered on time, and freefrom defects. Take into account clients feedbacks ', 'A', 2, 20, '2020-01-21 08:34:43', '0000-00-00 00:00:00', 1),
(3, 'QUANTITY OF WORK', 'Evaluate the employees ability to produce large amount / volume of work efficiently. Consider the number of projects and tasks accomplished (refer to Appendix page) ', 'A', 2, 20, '2020-01-21 08:35:01', '0000-00-00 00:00:00', 1),
(4, 'DECISION MAKING/PROBLEM SOLVING', 'Evaluate the employees ability to identify problem areas, gather facts and making timely, practical decisions. ', 'A', 2, 20, '2020-01-21 08:35:23', '0000-00-00 00:00:00', 1),
(5, 'ADMINISTRATION', 'Measures employees effectiveness in planning, organizing and efficiently handling work hours and eliminating unnecessary activities.', 'A', 1, 0, '2019-06-18 12:00:54', '0000-00-00 00:00:00', 1),
(6, 'COMMITMENT', 'Make things happen by  creatively maximizing our resources to ensure each others success. Evaluate the employees tendency towards self-initiated actions without waiting for instructions. ', 'B', 2, 20, '2020-01-21 11:11:32', '0000-00-00 00:00:00', 1),
(7, 'ACCOUNTABILITY', 'he obligations of an individual or organization to account for its activities, accept responsibilities for  them and to disclose the results  in a transparent manner. Makes carefully weighed decisions and accepts consequences for action and willingness to assume Responsibility. ', 'B', 2, 20, '2020-01-21 11:12:02', '0000-00-00 00:00:00', 1),
(8, 'RESPONSIVENESS', 'The quality of reacting quickly and positively. Strive to be the best, not just better or good enough. Have the highest chance of becoming productive. Paying attention, care enough about what he or she is talking about, no waiting time. ', 'B', 2, 20, '2020-01-21 11:12:22', '0000-00-00 00:00:00', 1),
(9, 'TRUSTWORTHY ', 'Honesty in everything you do; Take into consideration the employees willingness to put company interests above self-interest. Be reliable and keep your word. When you say that you will do something for someone, then do it. Make good friends with Manager/ \r\nSupervisor, Colleagues, Subordinates Clients and Customers. ', 'B', 2, 20, '2020-01-21 11:12:35', '0000-00-00 00:00:00', 1),
(10, 'TEAMWORK AND COOPERATION', 'he process of working collaboratively with a group of people in order to achieve the common goal. Always seeks ways to continuously improve existing procedure  or process to prevent recurrence of problems. Actively participates in any problem solving activities with his team and uses these opportunities to coach and guide his staff. Proactively working together and being accountable to each other to achieve  \r\nour goal. Has a positive approach towards work, company policies and people. ', 'B', 2, 20, '2020-01-21 11:23:46', '0000-00-00 00:00:00', 1),
(11, 'ADHERENCE TO COMPANY RULES & REGULATIONS', 'Evaluate the employees conformity  to company rules and regulations and policies. ', 'C', 2, 10, '2020-01-21 08:35:40', '0000-00-00 00:00:00', 1),
(12, 'ATTENDANCE & PUNCTUALITY', 'Consider the employees absences and tardiness based on Attendance reports ', 'C', 2, 10, '2020-01-21 08:35:52', '0000-00-00 00:00:00', 1),
(13, 'Hello World', 'Evaluate the employees familiarity with all phases and details of the job. Measures effectiveness in keeping knowledgeable in methods, techniques and required skills; \nremaining current on new technologies and be able to apply it into the job in a short span of time.', 'C', 1, 0, '2019-06-20 05:48:51', '0000-00-00 00:00:00', 0),
(14, 'Product / Technical Knowledge', 'N/A', 'D', 1, 0, '2019-09-10 07:15:27', '0000-00-00 00:00:00', 0),
