INSERT INTO `hris_eval_ratings` (`id`, `eval_type`, `rating`, `rating_2`, `description`, `equivalent_rating`, `score`, `created_at`, `updated_at`, `enabled`) VALUES
(1, 'type_1', 5, '4.5 to 5.0', 'Contributions have tremendous and consistently positive impact and value to the department and or the organization. May be unique, often one-time achievements that measurably improve progress towards organizational goals. Easily recognized as a top performer compared to peers. Viewed as an excellent resource for providing training, guidance, and support to others. Demonstrates high-level capabilities and proactively takes on higher levels of responsibility. s', 'OUTSTANDING PERFORMANCE (O) ', '95%-100% ', '2020-01-21 06:44:11', '0000-00-00 00:00:00', 1),
(2, 'type_1', 4, '3.5 to 4.4', 'Consistently demonstrates high level of performance. Consistently works toward overall objectives of the department and or organization. Viewed as a role model in position. Demonstrates high levels of effort, effectiveness, and judgment with limited or no supervision. ', 'Very Good Performance (VG) ', '86%-94% ', '2020-01-21 06:44:40', '0000-00-00 00:00:00', 1),
(3, 'type_1', 3, '2.5 to 3.4', 'Consistently demonstrates effective performance. Performance is reflective of a fully qualified and experienced individual in this position. Viewed as someone who gets the job done and effectively prioritizes work. Contributes to the overall objectives of the department and or the organization. Achieves valuable accomplishments in several critical areas of the job. ', 'Good Performance (G) ', '80%-85% ', '2020-01-21 06:45:09', '0000-00-00 00:00:00', 1),
(4, 'type_1', 2, '1.5 to 2.4', 'Working toward gaining proficiency. Demonstrates satisfactory performance inconsistently. Achieves some but not all goals and is acquiring necessary knowledge and skills. ', 'Fair Performance (F) ', '75%-79% ', '2020-01-21 06:45:38', '0000-00-00 00:00:00', 1),
(5, 'type_1', 1, '0 to 1.4', 'The quality of performance is inadequate and shows little or no improvement. Knowledge, skills, and abilities have not been demonstrated at appropriate levels. ', 'Poor Performance (P) ', '75%-below', '2020-01-21 06:47:44', '0000-00-00 00:00:00', 1),
(6, 'type_1', 6, '', 'dsfasfad', 'sasdfasdf', '95%-1001% ', '2019-06-19 10:57:42', '0000-00-00 00:00:00', 0),
(7, 'type_1', 7, '', 'dsadfasfsaf', 'afsdfasf', 'asdfsadf', '2019-06-19 10:57:36', '0000-00-00 00:00:00', 0),
(8, 'type_1', 8, '', 'Contributions have tremendous and consistently positive impact and value to the department and or the organization. May be unique, often one-time achievements that measurably improve progress towards organizational goals. Easily recognized as a top performer compared to peers. Viewed as an excellent resource for providing training, guidance, and support to others. Demonstrates high-level capabilities and proactively takes on higher levels of responsibility.', 'fgsdgs', 'sdgsg', '2019-06-19 10:57:31', '0000-00-00 00:00:00', 0),
(9, 'type_2', 5, '', 'Models the way', 'OUTSTANDING PERFORMANCE (O) ', '95%-100%', '2019-09-10 06:10:28', '0000-00-00 00:00:00', 1),
(10, 'type_2', 4, '', 'Always exhibits competency', 'Very Good Performance (VG) ', '86%-94% ', '2019-09-10 06:10:28', '0000-00-00 00:00:00', 1),
(11, 'type_2', 3, '', 'Exhibits competency most of the time', 'Good Performance (G) ', '80%-85% ', '2019-09-10 06:10:28', '0000-00-00 00:00:00', 1),
(12, 'type_2', 2, '', 'Exhibits competency half of the time or occasionally ', 'Fair Performance (F) ', '75%-79% ', '2019-09-10 06:10:28', '0000-00-00 00:00:00', 1),
(13, 'type_2', 1, '', 'Does not exhibits competency', 'Poor Performance (P) ', '75%-below', '2019-09-10 06:10:28', '0000-00-00 00:00:00', 1);

